const [email, setEmail] = useState("");
const handleClicker = (e) => {
  e.preventDefault();
  alert("Welcome to the Login Page");
  console.log(username);
  console.log(pass);
  console.log(phone);
  console.log(email);
  console.log([username, pass, phone, email]);
};

function Home() {
  return (
    <>
    <Navbar/>
    <Signup/>
    </>
  )
}

export default Home
